import React from "react";
import { Link } from "react-router-dom";

function RoomsItem(props) {
  return (
    <>
      <li className="rooms__item">
        <Link className="rooms_item__link">
          <img className="rooms__item__img" alt="room" />
        </Link>
        <div className="rooms__item__title">{props.name}</div>
        <div className="rooms__item__location">{props.location}</div>
        <div className="rooms_item__guest">{props.totalGuest}</div>
        <div className="rooms__item__stars">Stars:</div>
        <div className="rooms__item__comments">comments</div>
        <div className="rooms__item__like"></div>
        <div className="rooms__item__price">/night</div>
      </li>
    </>
  );
}

export default RoomsItem;
